// src/components/Duckling.js
import React from 'react';
import ducklingImage from '../assets/duckling.png';
import './Duckling.css';

const Duckling = () => {
  return (
    <div className="duckling">
      <img src={ducklingImage} alt="Duckling" />
    </div>
  );
};

export default Duckling;
